const items = $input.all();

const updatedItems = items.map((item) => {
  const user = item.json;

  // Normalize property names to handle variations
  const shippingAddress = user.shippingAddress || user['SHIPPING ADRES'] || '';
  const billingAddress = user.billingAddress || user['BILLING ADRESS'] || '';
  const email = user.email || user.EMAIL || '';
  const ip = user.ip || user.IP || '';
  const orderValue = typeof user.orderValue === "number" ? user.orderValue : Number(user.orderValue) || 0;

  let level = 0;
  const rulesTriggered = [];

  // --- Rule 1: Mismatched shipping & billing addresses ---
  if (shippingAddress && billingAddress && shippingAddress !== billingAddress) {
    level = 1;
    rulesTriggered.push(`Mismatched address: ${billingAddress} â‰  ${shippingAddress}`);
  }

  // --- Rule 2: Disposable or temp email domain ---
  const disposableDomains = ["mail-temp.com", "protonmail.com", "tempmail.com"];
  const emailDomain = email.split("@")[1]?.toLowerCase();
  if (emailDomain && disposableDomains.includes(emailDomain)) {
    level = 1;
    rulesTriggered.push("Disposable email domain");
  }

  // --- Rule 3: Suspicious VPN IP (e.g., starts with 192. or known VPN range) ---
  const cleanedIp = ip.trim();
  if (cleanedIp.startsWith("192.") || cleanedIp.startsWith("185.")) {
    level = 1;
    rulesTriggered.push(`Suspicious IP: ${cleanedIp}`);
  }

  // --- Rule 4: High order value (e.g., > â‚¹10,000) ---
  if (orderValue > 10000) {
    level = 1;
    rulesTriggered.push(`High order value: â‚¹${orderValue}`);
  }

  // --- AI Risk Score: 25 points per rule triggered ---
  const aiRiskScore = Math.min(rulesTriggered.length * 25, 100);

  // --- AI Notes ---
  const aiNotes = rulesTriggered.length
    ? `Flagged for: ${rulesTriggered.join("; ")}`
    : "No suspicious behavior detected.";

  // --- Risk Level Classification ---
  let finalRiskLevel = "Low";
  if (aiRiskScore >= 75) finalRiskLevel = "High";
  else if (aiRiskScore >= 50) finalRiskLevel = "Medium";

  return {
    json: {
      ...user,
      shippingAddress,
      billingAddress,
      email,
      ip,
      triggeredRules: rulesTriggered,
      aiRiskScore,
      aiNotes,
      finalRiskLevel
    }
  };
});

return updatedItems;

