 const items = $input.all();
const fallback = $('Apply Fraud Rules').first()?.json || {};

const results = items.map(item => {
  const original = item.json || {};
  const content = original.choices?.[0]?.message?.content;

  // Handle missing or invalid content
  if (typeof content !== 'string') {
    return {
      json: {
        error: 'Invalid or missing content',
        score: 0,
        notes: 'No notes provided',
        rawContext: original
      }
    };
  }

  // Extract JSON block from content
  const jsonMatch = content.match(/\{[\s\S]*?\}/);
  if (!jsonMatch) {
    return {
      json: {
        error: 'No valid JSON block found in content',
        score: 0,
        notes: 'No notes provided',
        rawContext: content
      }
    };
  }

  let parsed;
  try {
    parsed = JSON.parse(jsonMatch[0]);
  } catch (e) {
    return {
      json: {
        error: `JSON parsing error: ${e.message}`,
        score: 0,
        notes: 'No notes provided',
        rawContext: content
      }
    };
  }

  return {
    json: {
      score: parsed.fraudScore ?? parsed.score ?? 0,
      notes: parsed.notes ?? 'No notes provided',
      rawContext: content
    }
  };
});

return results;

