const input = $("Code1").first().json.body;  // Access the input body directly

// Split by each transaction using a pattern that marks new transactions
const transactions = input.split(/Transaction #\d+/).filter(t => t.trim() !== '');

// Define a helper function to extract field values
function extractField(text, fieldLabel) {
    const regex = new RegExp(`${fieldLabel}\\s*:\\s*(.+?)\\n`);
    const match = text.match(regex);
    return match ? match[1].trim() : null;
}

// Process each transaction, skipping any empty or invalid entries
const results = transactions.map(tx => {
    return {
        "Order ID": extractField(tx, 'Order ID'),
        "Risk Score": Number(extractField(tx, 'Risk Score')) || 0,
        "Triggered Rules": extractField(tx, 'Triggered Rules')?.split(',').map(s => s.trim()).filter(Boolean) || [],
        "Feedback": extractField(tx, 'Feedback'),
        "AI Notes": extractField(tx, 'AI Notes'),
        "Final Action": extractField(tx, 'Final Action'),
        "Order Status": extractField(tx, 'Order Status'),
    };
}).filter(r => r["Order ID"] !== null);  // Remove empty/invalid transactions

return results.map(r => ({ json: r }));
